import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyNavbar from './MyNavbar';
import MyCarousel from './MyCarousel';

class Home extends Component {

    render() {
        return (
            <div>
                <MyNavbar />
				<MyCarousel />
            </div>
        );
    }

}

export default Home;
